import './App.css';
import { Router, Switch } from "react-router-dom";
import Login from './Login/Login.js';
import Dashboard from './Dashboard/Dashboard.js';
function App() {
  return (
    <Switch>
        <Router path="/" component={Login}/>
        <Router path="/Dashboard" component={Dashboard}/>
    </Switch>
  );
}

export default App;
